(1, 'New Account', 'Welcome, [full_name]!', '<div style=\\\"background: #F6F6F6; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12px; margin: 0; padding: 0;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"padding: 20px 0 20px 0;\\\" align=\\\"center\\\" valign=\\\"top\\\"><!-- [ header starts here] -->\r\n<table style=\\\"border: 1px solid #e0e0e0; width: 650px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"10\\\" bgcolor=\\\"FFFFFF\\\">\r\n<tbody>\r\n<tr>\r\n<td valign=\\\"top\\\"><a href=\\\"{{store url=\\\"><img style=\\\"margin-bottom: 10px;\\\" src=\\\"{logo_url}\\\" alt=\\\"{logo_alt}\\\" border=\\\"0\\\" /></a></td>\r\n</tr>\r\n<!-- [ middle starts here] -->\r\n<tr>\r\n<td valign=\\\"top\\\">\r\n<h1 style=\\\"font-size: 22px; font-weight: normal; line-height: 22px; margin: 0 0 11px 0;\\\">Dear [full_name],</h1>\r\n<p style=\\\"font-size: 12px; line-height: 16px; margin: 0 0 16px 0;\\\">Welcome to [site_title]. To log in when visiting our site just click <a style=\\\"color: #1e7ec8;\\\" href=\\\"[site_url]/login\\\">Login</a> or <a style=\\\"color: #1e7ec8;\\\" href=\\\"[site_url]/customer/account\\\">My Account</a> at the top of every page, and then enter your e-mail address and password.</p>\r\n<p style=\\\"border: 1px solid #E0E0E0; font-size: 12px; line-height: 16px; margin: 0; padding: 13px 18px; background: #f9f9f9;\\\">Use the following values when prompted to log in:<br /> <strong>E-mail</strong>: [email]<br /> <strong>Password</strong>: [password]</p>\r\n<p style=\\\"font-size: 12px; line-height: 16px; margin: 0 0 8px 0;\\\">When you log in to your account, you will be able to do the following:</p>\r\n<ul style=\\\"font-size: 12px; line-height: 16px; margin: 0 0 16px 0; padding: 0;\\\">\r\n<li style=\\\"list-style: none inside; padding: 0 0 0 10px;\\\">&ndash; Proceed through checkout faster when making a purchase</li>\r\n<li style=\\\"list-style: none inside; padding: 0 0 0 10px;\\\">&ndash; Check the status of orders</li>\r\n<li style=\\\"list-style: none inside; padding: 0 0 0 10px;\\\">&ndash; View past orders</li>\r\n<li style=\\\"list-style: none inside; padding: 0 0 0 10px;\\\">&ndash; Make changes to your account information</li>\r\n<li style=\\\"list-style: none inside; padding: 0 0 0 10px;\\\">&ndash; Change your password</li>\r\n<li style=\\\"list-style: none inside; padding: 0 0 0 10px;\\\">&ndash; Store alternative addresses (for shipping to multiple family members and friends!)</li>\r\n</ul>\r\n<p style=\\\"font-size: 12px; line-height: 16px; margin: 0;\\\">If you have any questions about your account or any other matter, please feel free to contact us at [get_option name=contact_emial]&nbsp;or by phone at [contact_number].</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background: #EAEAEA; text-align: center;\\\" align=\\\"center\\\" bgcolor=\\\"#EAEAEA\\\"><center>\r\n<p style=\\\"font-size: 12px; margin: 0;\\\">Thank you again, <strong>[site_title]</strong></p>\r\n</center></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', '2015-08-12 14:47:53', 'Active', 'Active', 'Dear [full_name],\r\n\r\nWelcome to [site_title]. \r\nUse the following values when prompted to log in:\r\nE-mail: [email]\r\nPassword: [password]\r\n\r\nThank you again, [site_title]'),
(2, 'Forgot Password', 'Password Reset Confirmation for [full_name]', '<div style=\\\"background: #F6F6F6; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12px; margin: 0; padding: 0;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"padding: 20px 0 20px 0;\\\" align=\\\"center\\\" valign=\\\"top\\\">\r\n<table style=\\\"border: 1px solid #e0e0e0; width: 650px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"10\\\" bgcolor=\\\"FFFFFF\\\">\r\n<tbody>\r\n<tr>\r\n<td valign=\\\"top\\\"><a style=\\\"color: #1e7ec8;\\\" href=\\\"[site_url]\\\"><img src=\\\"[logo_url]\\\" alt=\\\"[site_title]\\\" /></a></td>\r\n</tr>\r\n<tr>\r\n<td valign=\\\"top\\\">\r\n<h1 style=\\\"font-size: 22px; font-weight: normal; line-height: 22px; margin: 0 0 11px 0;\\\">Dear [full_name],</h1>\r\n<p style=\\\"font-size: 12px; line-height: 16px; margin: 0 0 8px 0;\\\">There was recently a request to change the password for your account.</p>\r\n<p style=\\\"font-size: 12px; line-height: 16px; margin: 0;\\\">If you requested this password change, please click on the following link to reset your password: <a style=\\\"color: #1e7ec8;\\\" href=\\\"[site_url]customer/reset/?uid=[id]&amp;token=[token_num]\\\">[site_url]customer/reset/?uid=[id]&amp;token=[token_num]<br /></a></p>\r\n<p style=\\\"font-size: 12px; line-height: 16px; margin: 0;\\\">If clicking the link does not work, please copy and paste the URL into your browser instead.</p>\r\n<br />\r\n<p style=\\\"font-size: 12px; line-height: 16px; margin: 0;\\\">If you did not make this request, you can ignore this message and your password will remain the same.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #eaeaea; text-align: center;\\\">\r\n<p style=\\\"font-size: 12px; margin: 0; text-align: center;\\\">Thank you, <strong>[site_title]<br /></strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', '2015-08-10 19:18:16', 'Active', 'Active', NULL),
(5, 'Account Confirmation', 'Account confirmation for {{var customer.name}}', '<body style=\"background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;\">\r\n<div style=\"background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;\">\r\n<table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" height=\"100%\" width=\"100%\">\r\n        <tr>\r\n            <td align=\"center\" valign=\"top\" style=\"padding:20px 0 20px 0\">\r\n                <!-- [ header starts here] -->\r\n                <table bgcolor=\"FFFFFF\" cellspacing=\"0\" cellpadding=\"10\" border=\"0\" width=\"650\" style=\"border:1px solid #E0E0E0;\">\r\n                    <tr>\r\n                        <td valign=\"top\">\r\n                            <a href=\"{{store url=\"\"}}\"><img src=\"{{var logo_url}}\" alt=\"{{var logo_alt}}\" style=\"margin-bottom:10px;\" border=\"0\"/></a>\r\n                        </td>\r\n                    </tr>\r\n                    <!-- [ middle starts here] -->\r\n                    <tr>\r\n                        <td valign=\"top\">\r\n                            <h1 style=\"font-size:22px; font-weight:normal; line-height:22px; margin:0 0 11px 0;\">Dear {{htmlescape var=$customer.name}},</h1>\r\n                            <p style=\"font-size:12px; line-height:16px; margin:0 0 16px 0;\">Your e-mail {{var customer.email}} must be confirmed before using it to log in to our store.</p>\r\n                            <p style=\"font-size:12px; line-height:16px; margin:0 0 8px 0;\">To confirm the e-mail and instantly log in, please, use <a href=\"{{store url=\"customer/account/confirm/\" _query_id=$customer.id _query_key=$customer.confirmation _query_back_url=$back_url}}\" style=\"color:#1E7EC8;\">this confirmation link</a>. This link is valid only once.</p>\r\n                            <p style=\"border:1px solid #E0E0E0; font-size:12px; line-height:16px; margin:0 0 16px 0; padding:13px 18px; background:#f9f9f9;\">\r\n                                Use the following values when prompted to log in:<br/>\r\n                                <strong>E-mail:</strong> {{var customer.email}}<br/>\r\n                                <strong>Password:</strong> {{htmlescape var=$customer.password}}<p>\r\n                            <p style=\"font-size:12px; line-height:16px; margin:0;\">If you have any questions about your account or any other matter, please feel free to contact us at <a href=\"mailto:{{config path=\'trans_email/ident_support/email\'}}\" style=\"color:#1E7EC8;\">{{config path=\'trans_email/ident_support/email\'}}</a> or by phone at {{config path=\'general/store_information/phone\'}}.</p>\r\n                        </td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td bgcolor=\"#EAEAEA\" align=\"center\" style=\"background:#EAEAEA; text-align:center;\"><center><p style=\"font-size:12px; margin:0;\">Thank you again, <strong>{{var store.getFrontendName()}}</strong></p></center></td>\r\n                    </tr>\r\n                </table>\r\n            </td>\r\n        </tr>\r\n    </table>\r\n</div>\r\n</body>', NULL, 'Active', 'Active', NULL);
