(1, '/', 'Home', 0, 0, NULL, '<section id=\"Tokenomics_section\" class=\"my-5\">\r\n<div class=\"container\">\r\n<div class=\"section_header text-center mb-5\">\r\n<h1 class=\"grey_big_title fw-bold\">Tokenomics</h1>\r\n<h4 class=\"fw-bold\">Our <cite>Tokenomics</cite></h4>\r\n</div>\r\n<div class=\"row align-items-center flex-row-reverse mt-4\">\r\n<div class=\"col-md-6\">\r\n<div class=\"feature-block-card shadow\">\r\n<div class=\"mb-3\"><img src=\"../../../assets/uploads/burns.png\" alt=\"feature block card icon\" /></div>\r\n<h5 class=\"theme-color\">Auto &amp; Manual Burns</h5>\r\n<div>\r\n<p>Very soon we will burn 50% of total Supply. Then we will burn some supply every month and will continue to burn, until the price of Binance Dog will reach to one Dolor.<br /><br />When the price will reach to one Dollar, then it will be forever locked to minimum one Dollar, and the price will never fall below one Dollar.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 mt-5\">\r\n<div class=\"feature-block-card shadow\">\r\n<div class=\"mb-3\"><img src=\"../../../assets/uploads/rewards.png\" alt=\"feature block card icon\" /></div>\r\n<h5 class=\"theme-color\">Rewards Holding</h5>\r\n<div>\r\n<p>5% of the total supply will be distributed to the holders every month for one year and will be given only to those holders who will be the members of our Telegram Group (Binance Doge Holders) and will promote the Binance Doge on daily basis.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 mt-2\">\r\n<div class=\"feature-block-card shadow\">\r\n<div class=\"mb-3\"><img src=\"../../../assets/uploads/locked.png\" alt=\"feature block card icon\" /></div>\r\n<h5 class=\"theme-color\">Locked Liquidty</h5>\r\n<div>\r\n<p>Unruggable, majority of LP tokens locked &amp; some burned so theres always LP.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6  mt-5\">\r\n<div class=\"feature-block-card shadow\">\r\n<div class=\"mb-3\"><img src=\"../../../assets/uploads/charity.png\" alt=\"feature block card icon\" /></div>\r\n<h5 class=\"theme-color\">Charity Wallet</h5>\r\n<div>\r\n<p>We have a designated charity wallet that receives redistributions that are used to support our charity partners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', NULL, 'Young people to fight impunity in Madagascar', 'Young people, fight impunity', 'Trained by the Rary Aro Mada project, young human rights defenders contribute to the monitoring of human rights violations and the fight against impunity in Madagascar. Read the story', 'Published', NULL, 'full_width', 0, NULL, '\"{\\\"icon\\\":\\\"\\\"}\"', NULL, '2022-09-05 21:16:21', NULL),
(3, 'about', 'About UN Human Rights', 0, 1, NULL, '<p>The Office of the High Commissioner for Human Rights (UN Human Rights) is the<span>&nbsp;</span><strong>leading UN entity on human rights</strong>. We represent the world\'s commitment to the promotion and protection of the full range of human rights and freedoms set out in the<span>&nbsp;</span><a href=\"https://www.ohchr.org/EN/UDHR/Pages/UDHRIndex.aspx\">Universal Declaration of Human Rights</a>.</p>\r\n<p>Both the<span>&nbsp;</span><a href=\"https://www.ohchr.org/EN/AboutUs/Pages/HighCommissioner.aspx\">High Commissioner</a><span>&nbsp;</span>and the Office have a unique role to:</p>\r\n<ul>\r\n<li><strong>Promote and protect all human rights</strong>: We speak out objectively in the face of human rights violations and help elaborate the standards that are used to evaluate human rights progress worldwide.</li>\r\n<li><strong>Help empower people</strong>: Our research, education, and advocacy activities, contributes to the increased awareness and engagement by the international community and the public on human rights issues. This means thousands of people in all regions of the world are empowered to claim their rights.</li>\r\n<li><strong>Assist Governments</strong>: Through our field presences, we help prevent abuses and contribute to defusing situations that could lead to conflict. Our monitoring and analysis feeds sensitive decision-making and development programming. We also provide capacity-building and legal advice to thousands, supporting the development and judicious enactment of laws and policies the world around.</li>\r\n<li><strong>Inject a human rights perspective into all UN programmes</strong>: We mainstream human rights into all UN programmes to ensure that peace and security, development, and human rights - the three pillars of the UN - are interlinked and mutually reinforced.</li>\r\n</ul>\r\n<br /><a class=\"link-item--with-arrow-light-blue-underline\" href=\"https://www.ohchr.org/EN/AboutUs/Pages/Mandate.aspx\">Learn more about our Mandate</a><br />\r\n<h3 class=\"heading-with-border\">History of the mandate</h3>\r\n<p>The UN General Assembly established The Office of the High Commissioner for Human Rights in December 1993 through its<span>&nbsp;</span><a href=\"https://www.un.org/ga/search/view_doc.asp?symbol=A/RES/48/141\">resolution 48/141</a><span>&nbsp;</span>which also details its mandate. This was just a few months after the World Conference on Human Rights adopted the<span>&nbsp;</span><a href=\"https://www.ohchr.org/EN/AboutUs/Pages/ViennaWC.aspx\">Vienna Declaration and Plan of Action</a>.</p>\r\n<p>Adopted by 171 States, the Vienna Declaration renewed the world\'s commitment to human rights. It also called for strengthening and harmonizing the monitoring capacity of the United Nations system with regards to human rights.</p>\r\n<p><a class=\"link-item--with-arrow-light-blue-underline\" href=\"https://www.ohchr.org/EN/AboutUs/Pages/BriefHistory.aspx\">Read more about the history of UN Human Rights</a></p>\r\n<p>&nbsp;</p>\r\n<h3 class=\"heading-with-border\">Our mission</h3>\r\n<p>In carrying out our mission UN Human Rights:</p>\r\n<ul>\r\n<li>Gives priority to addressing the most pressing human rights violations, both acute and chronic, particularly those that put life in imminent peril</li>\r\n<li>Focuses attention on those who are at risk and vulnerable on multiple fronts</li>\r\n<li>Pays equal attention to the realization of civil, cultural, economic, political, and social rights, including the right to development</li>\r\n<li>Measures the impact of its work through the substantive benefit that is accrued, through it, to individuals around the world</li>\r\n</ul>\r\n<p><a class=\"link-item--with-arrow-light-blue-underline\" href=\"https://www.ohchr.org/EN/AboutUs/Pages/MissionStatement.aspx\">View more about our Mission</a></p>\r\n<p>&nbsp;</p>\r\n<h3 class=\"heading-with-border\">Our strategic vision for human rights work</h3>\r\n<p>To fulfil its mission, UN Human Rights follows a robust framework of results known as the OHCHR Management Plan (OMP). This roadmap is based on the outcomes of consultations with Member States, the UN system, civil society, the donor community and the private sector. The current OMP is strongly anchored to the 2030 Development Agenda and covers the period from 2018-2021 inclusive.</p>\r\n<p><a class=\"link-item--with-arrow-light-blue-underline\" href=\"https://www.ohchr.org/EN/AboutUs/ManagementPlan/Pages/Roadmap.aspx\">Get an overview of OHCHR\'s 2018-2021 roadmap</a></p>', NULL, 'About UN Human Rights', 'About UN Human Rights', 'About UN Human Rights', 'Published', '2022-09-06-142239page-img.jpeg', 'default', 2, NULL, '\"{\\\"icon\\\":\\\"\\\"}\"', '2019-11-13 14:19:05', '2022-09-06 15:22:39', NULL),
